import Slider from "react-slick";
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import styles from "./MoviesSlide.module.css"

function MoviesSlide({ imageUrl, title, vote }) {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <Styled_Slide {...settings}>
      <div>
        <img src={imageUrl} alt="movieImage" id={styles.poster} />
        {/* <h2>{title}</h2>
        <p>{vote}</p>
        <br></br> */}
      </div>
    </Styled_Slide>
  )
};

export default MoviesSlide;
